#define kTitleCase 1
#define kSentenceCase 2


char * core_case_string_len(const char * str, size_t len, short case_type);


char * core_case_string(const char * str, short case_type) {
	DString * result = d_string_new("");

	// Stop at first line ending, if present
	char * stop = (char *) str;

	while (!char_is_line_ending(*stop)) {
		stop++;
	}

	char * title = core_case_string_len(str, stop - str, case_type);

	d_string_append(result, title);

	// Add anything we did not parse back to end
	while (*stop != '\0') {
		d_string_append_c(result, *stop);
		stop++;
	}

	// Clean up
	free(title);
	title = result->str;
	d_string_free(result, false);

	return title;
}


char * title_case_string(const char * str) {
	return core_case_string(str, kTitleCase);
}


char * sentence_case_string(const char * str) {
	return core_case_string(str, kSentenceCase);
}


char * core_case_string_len(const char * str, size_t len, short case_type) {
	DString * out = d_string_new("");

	DString * in = d_string_new(str);
	bool lc = true;
	char * test = in->str;

	// Where do we stop parsing?
	const char * stop = in->str + len;

	while (lc && test < stop) {
		if (*test >= 'a' && *test <= 'z') {
			lc = false;
		}

		test++;
	}

	if (lc) {
		test = in->str;

		while (test < stop) {
			*test = tolower(*test);

			test++;
		}
	}

	// Create a scanner (for re2c)
	Scanner s;
	s.start = in->str;
	s.cur = s.start;

	int type;								// TOKEN type

	bool first = true;
	bool upper;

	const char * last_stop = in->str;
	stop = in->str + len;

	do {
		// Scan for next word
		type = scan(&s, stop);

		if (type &&
				(s.start != last_stop) &&
				(stop > last_stop)) {
			d_string_append_c_array(out, last_stop, (int)(s.start - last_stop));
		}

		if (s.cur > stop) {
			s.cur = stop;
		}

		switch (type) {
			case 0:
				// Finished
				d_string_append_c_array(out, last_stop, (int)(stop - last_stop));
				break;

			case WORD_SHORT:
				if (first) {
					// Capitalize short words at beginning of title
					print_cap;
				} else {
					// Otherwise lower case them
					print_lower;
				}

				break;

			case WORD_UPPER:
				// Already upper case
				print_upper;
				break;

			case WORD_LAST:
			case WORD_PLAIN:

				// Capitalize any word at end of title
				if (case_type == kTitleCase) {
					print_cap;
				} else {
					if (first) {
						print_cap;
					} else {
						print_lower;
					}
				}

				break;

			case START_SUBSENTENCE:
				first = true;

			case START_SUBPHRASE:
				if (case_type == kTitleCase) {
					first = true;
				}

			case END_SUBPHRASE:
			case PUNCT:
			case WORD_MIXED:
			case WORD_URL:
				print_as_is;
				break;
		}

		if (first && type == PUNCT) {

		} else if (type != START_SUBSENTENCE && type != START_SUBPHRASE) {
			first = false;
		}

		// Remember where token ends to detect skipped characters
		last_stop = s.cur;
	} while (type != 0);

	// Trim leading/lagging whitespace
	while (char_is_whitespace(*(out->str))) {
		d_string_erase(out, 0, 1);
	}

	while (out->currentStringLength && char_is_whitespace(out->str[out->currentStringLength - 1])) {
		d_string_erase(out, out->currentStringLength - 1, 1);
	}

	char * result = out->str;
	d_string_free(out, false);
	d_string_free(in, true);

	return result;
}


char * title_case_string_len(const char * str, size_t len) {
	return core_case_string_len(str, len, kTitleCase);
}

char * sentence_case_string_len(const char * str, size_t len) {
	return core_case_string_len(str, len, kSentenceCase);
}


